  return (
    <div
      style={{ maxWidth: 450, margin: "0% auto", padding: 16, fontSize: 14 }}
    >
      <Navbar />

      <BookEntry
        date={"October 29, 2021"}
        tags={["Athelas", "Healthcare"]}
        description="3-Minute FDA-Cleared Blood Diagnostics Powered by Cutting Edge Hardware and ML"
      />
    </div>
  );
}
